import React from "react";
import Logo from "./../../img/aboutUs.webp";
import Menu from "./Menu";
export default function Header() {
  return (
    <header className="col-12 bg-dark" style={{ height: "70px" }}>
      <div className="row justify-between">
        <figure className="col-3" style={{ height: "100%" }}>
          <img
            src={Logo}
            className="col-12"
            style={{ height: "100%" }}
            alt=""
          />
        </figure>
        <div className="col-7">
          <Menu />
        </div>
      </div>
    </header>
  );
}
